function initChangeLang(){$(document).ready(function(){actualLang=getSessionLang(),null==actualLang?(pageLang=getBrowserLang(),setSessionLang(pageLang)):pageLang=actualLang,changeLang(pageLang)})}function changeLang(n){pageLang=n,setSessionLang(pageLang),$.each($(".translatable"),function(n,e){changeFieldText(e,pageLang)})}function getTextIndex(n,e){var a;return $.each(texts[e],function(t){$(n).attr("id")in texts[e][t]&&(a=t)}),null==a?(console.warn("Id "+$(n).attr("id")+" marked as translatable and there is no key in texts file for "+pageLang),null):a}function changeFieldText(n,e){langExists(e)&&(index=getTextIndex(n,e),null!=index&&$(n).text(texts[e][index][$(n).attr("id")]))}function langExists(n){return n in texts?!0:(console.warn(n+" language is not in the texts file"),!1)}function getBrowserLang(){var n=navigator.language||navigator.userLanguage;return n.split("-")[0]?n.split("-")[0].toUpperCase():"EN"}function getSessionLang(){return sessionStorage.getItem(defaultKey)}function setSessionLang(n){sessionStorage.setItem(defaultKey,n)}var pageLang,defaultKey="com.github.turkissh.languajs.pageLang";